import React, { Component } from 'react';


export class Rabattrechner extends Component {
    constructor(props) {
      super(props);
      this.state = {
          A: 0,
          B: 0,
          output: 0
        };

      this.handleChange = this.handleChange.bind(this);
      this.rabattrechner = this.rabattrechner.bind(this);
    }

    handleChange(event) {

      this.setState({A: event.target.value});
    }

    rabattrechner(){
      this.output =  this.A + this.B; 
    }

    render() {
      return (
        <div onSubmit={this.handleSubmit}>
          <label>
            Name:
            A:<input type="number" value={this.state.A} onChange={this.handleChange} />
            B:<input type="number" value={this.state.B} onChange={this.handleChange} />
          </label>
        <button onClick={this.rabattrechner}>Run</button>
        <div>
            {this.output}
        </div>
        </div>
      );
    }
  }
  export default Rabattrechner;
